import React, {useEffect, useState} from 'react';

import axios from 'axios';

function App() {
    const [data, setData] = useState(null);

    useEffect(() => {
        axios.get('https://coronavirus-tracker-api.herokuapp.com/all')
            .then(response => {
                const allThree = response;

                console.log(allThree.data.confirmed.latest);

                setData(allThree.data)
            })
    }, []);


    return (
    <div>
        <h1>CORONA</h1>
    </div>
    );
}

export default App;
